<template>
  <div class="classify">
    <normal-header title='分类'></normal-header>
    <header-type :types='typeList' @click = 'onChange'></header-type>
    <cartoon-list></cartoon-list>
  </div>
</template>

<script>
import CartoonList from '@/components/CartoonList'
import HeaderType from '@/components/HeaderType'
import NormalHeader from '@/components/NormalHeader'
import { getTypes } from '@/api/cartoon'
import { unformat } from '@/utils/apiHelp'
export default {
  name: 'Classify',
  components: {
    CartoonList,
    HeaderType,
    NormalHeader
  },
  data () {
    return {
      typeList: []
    }
  },
  methods: {
    getTypes () {
      getTypes()
        .then(res => {
          console.log(res)
          if (res.code === 200) {
            this.typeList = res.info
          } else {
            alert('网络错误')
          }
        })
        .catch(res => {
          console.log(res.msg)
        })
    },
    onChange (payload) {
      console.log(payload)
    }
  },
  created () {
    this.getTypes()
    var str = ''
    console.log(unformat(str))
  }
}
</script>

